USE hacksc;
CREATE TABLE CLASS(
	COURSEID VARCHAR(10) NOT NULL,
	TITLE TEXT(100) NOT NULL,
    SESSION	VARCHAR(5) NOT NULL,
    DAY	VARCHAR(5) NOT NULL,
    START_TIME TIME NOT NULL,
    END_TIME TIME NOT NULL,
    LOCATION TEXT NOT NULL,
    INSTRUCTOR TEXT(50),
    PRIMARY KEY(COURSEID, SESSION, DAY));
